import React from 'react';


const Navbar = ({item}) => {

        const listItem = item.map(item => {
            
            if (item) 
            return(
                <table key={item.id}>
                    <tbody>
                    <tr>
                    <td>Name: { item.name }</td>
                    <td>Age: { item.age }</td>
                    <td>Sex: { item.sex}</td>
                    </tr>
                    </tbody>

                </table>
            )

        })


        return(

            <div className={'navbar'}>
                {listItem}
            </div>

        );

}

export default Navbar;
